import React from "react";
import { Grid } from "@material-ui/core";
import PercentageCard from "./PercentageCard";

const PercentageStats = () => {
    return (
        <Grid container spacing={2}>
            <Grid item xs={12}>
                <Typography component="h2" variant="h5" className={classes.bold}>
                    Kasus di Seluruh Indonesia
                </Typography>
            </Grid>
            <Grid item xs={4}>
                <PercentageCard
                    percentage={100}
                    information="Dalam Perawatan"
                />
            </Grid>
            <Grid item xs={4}>
                <PercentageCard percentage={100} information="Pasien Sembuh" />
            </Grid>
            <Grid item xs={4}>
                <PercentageCard
                    percentage={100}
                    information="Pasien Meninggal"
                />
            </Grid>
        </Grid>
    );
};

export default PercentageStats;
